import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import FormHelperText from '@material-ui/core/FormHelperText';

const inputStyles = makeStyles({
    root: {
      width: '100%',
      margin: theme.spacing(2),
    },
});

function OriVASP() {
    const classes = inputStyles();
    return (
      <div>
        <FormHelperText>Originator VASP code</FormHelperText>
        <TextField id="oriCode" defaultValue="-"
          InputLabelProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function BeneVASP() {
    const classes = inputStyles();
    return (
      <div>
        <FormHelperText>Beneficiary VASP code</FormHelperText>
        <TextField id="beneCode" defaultValue="-"
          InputLabelProps={{ readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function Result() {
    const classes = inputStyles();
    return (
      <div>
        <FormHelperText>Beneficiary VASP code</FormHelperText>
        <TextField id="result" defaultValue="-"
          InputLabelProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

const useStyles = makeStyles((theme) => ({
    root: {
      border: '1px solid #666' ,
      padding: '30px 20px',
    }
}));

function Bridge() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <form action="">
                <OriVASP />
                <BeneVASP />
                <Result />
            </form>
        </div>
    );
}

export default Bridge;
